ANSWER:
 Informuojame, kad 2021 m. kovo 5 d.  Vilniaus miesto savivaldybės administracijos direktoriaus įsakymu Nr. 30-498/21 „Dėl Administracijos direktoriaus 2009-10-15 įsakymo Nr. 30-1783 „Dėl techninių eismo reguliavimo priemonių įrengimo ir jų priežiūros Vilniaus mieste tvarkos aprašo tvirtinimo“ pakeitimo“ buvo patvirtinti pėsčiųjų atitvarų kriterijai.
“67. Pėsčiųjų atitvarų įrengimo kriterijai:
67.1. Pėsčiųjų atitvarus būtina įrengti tik tose vietose, kur per pastaruosius dvejus metus yra įvykę du arba daugiau įskaitinių eismo įvykių, kai pėstieji išėjo į važiuojamąją kelio dalį, arba pėsčiųjų eismo sąlygų aplinkybė yra sudėtinė juodosios dėmės dalis ir kur leistinas greitis didesnis nei 30 km/val., o atitvarai būtų padėję išvengti eismo įvykio, užtikrinant, kad po pėsčiųjų atitvarų įrengimo liks bent 1,5 m pločio laisvas šaligatvis pėsčiųjų eismui.
67.2. Pėsčiųjų atitvarų įrengimas svarstytinas (jei nėra galimybės įrengti kitas priemones), jei vieta atitinka bent vieną iš šių kriterijų:
67.2.1. tose vietose, kur yra išėjimas į gatvę ties ugdymo įstaigomis, vaikų žaidimo aikštelėmis, gyvenamosios ar sporto paskirties pastatais, esant mažesniam kaip 2,25 m atstumui nuo išėjimo iki gatvės ar dviračių tako važiuojamosios dalies;
67.2.2. gatvių sankryžose, kur bent viena kryptimi nėra įrengta pėsčiųjų perėja, ir esant pagrindimui, kad jos įrengti pagal galiojančius teisės aktus negalima, nukreipiant pėsčiųjų srautą artimiausios pėsčiųjų perėjos ar pėsčiųjų perėjimo link;
67.2.3. viešojo transporto stotelių zonoje nesant apsauginės erdvės tarp paviljono ir dviračių tako, siekiant apriboti pėsčiųjų stovėjimą ant dviračių tako ar staigų išėjimą iš už paviljono, užtikrinant negalią turinčių asmenų patekimą per dviračių taką į viešojo transporto stotelės zoną;
67.2.4. vietose, kuriose yra aukštesni kaip 1,5–2 m pylimai su stačiais šlaitais, šalia yra gilesnių kaip 1 m vandens telkinių ir panašiai, jei yra prašymų juos įrengti arba yra įvykę nelaimingų atsitikimų dėl jų nebuvimo ir nesant galimybės saugumą užtikrinti kitomis priemonėmis.
67.3. Esant poreikiui apsaugoti eismo dalyvius su judėjimo ar regos negalia nuo galimo eismo įvykio ar padėti jų judėjimui (esant oficialiems prašymams / pasiūlymams / skundams ar kelio savininko sprendimui), prie įstaigų ir organizacijų įrengiami statybos techninius reglamentus ir ISO standartus atitinkantys pėsčiųjų turėklai.“.

Atsižvelgiant į kriterijus, pėsčiųjų atitvarų įrengti Plytinės g. neplanuojama.

